{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/cyrilolayinka/bellabeat-marketing-strategy?scriptVersionId=239985016\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"47a39254","metadata":{"papermill":{"duration":0.024311,"end_time":"2025-05-16T01:45:06.687217","exception":false,"start_time":"2025-05-16T01:45:06.662906","status":"completed"},"tags":[]},"source":["## Improving Bellabeat’s Marketing Strategy: A Data-Driven Approach\n","### Introduction\n","I am a junior data analyst on Bellabeat’s marketing analytics team. Bellabeat is a women-focused health tech company that manufactures smart wellness products like Leaf, Time, Spring, and the Bellabeat app. \n","\n","Bellabeat wants to become a leading global player in the smart wellness device industry. To do this, they need data-driven insights into how consumers are using smart fitness devices. My role as a junior data analyst is to explore existing trends, apply them to one Bellabeat product, and provide marketing recommendations based on the findings"]},{"cell_type":"markdown","id":"7e339e2b","metadata":{"papermill":{"duration":0.022516,"end_time":"2025-05-16T01:45:06.733018","exception":false,"start_time":"2025-05-16T01:45:06.710502","status":"completed"},"tags":[]},"source":["### My Goal\n","My goal is to Analyze smart device usage trends and apply them to improve Bellabeat’s marketing strategy.\n","\n","## THE ASK PHASE: OVERVIEW\n","At this stage, my focus is on defining the business problem and understanding how my  insights can guide Bellabeat’s marketing strategy.\n","\n","#### Objective of this analysis\n","- Identify key trends in smart device usage.\n","- Apply findings to Bellabeat’s target audience.\n","- Develop strategic recommendations to refine Bellabeat’s marketing approach.\n","\n","This research will guide the Bellabeat executive team in making data-driven decisions to position Bellabeat's products effectively within the competitive wellness technology industry."]},{"cell_type":"markdown","id":"2c79abe0","metadata":{"papermill":{"duration":0.021263,"end_time":"2025-05-16T01:45:06.777118","exception":false,"start_time":"2025-05-16T01:45:06.755855","status":"completed"},"tags":[]},"source":["#### The Stakeholders\n","This insights will be used by:\n","- Bellabeat executive team (Urska Sršen and Sando Mur) → They’ll make strategic decisions based on this  analysis.\n","- Marketing analytics team → They’ll use this findings to refine advertising efforts and engagement strategies.\n","- Bellabeat customers → The end users who will benefit from improved marketing and product positioning.\n","\n","### Business Task Statement\n","Bellabeat, a wellness technology company, wants to leverage consumer insights from smart device usage data to enhance its marketing strategy and expand its market presence. By analyzing trends in activity, sleep, stress, and hydration, Bellabeat aims to apply relevant insights to one of its products—either the Bellabeat app, Leaf, Time, Spring, or membership services—to improve user engagement and marketing effectiveness.\n","\n","## THE PREPARE PHASE\n","This is where I prepared the data for analysis. This involves cleaning and transforming the data to ensure it is suitable for analysis.\n","\n","### Preparing my work environment\n","All the libraries relevant to this phase are loaded below."]},{"cell_type":"code","execution_count":1,"id":"101312b0","metadata":{"execution":{"iopub.execute_input":"2025-05-16T01:45:06.829206Z","iopub.status.busy":"2025-05-16T01:45:06.825942Z","iopub.status.idle":"2025-05-16T01:45:08.452866Z","shell.execute_reply":"2025-05-16T01:45:08.450787Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":1.656182,"end_time":"2025-05-16T01:45:08.456022","exception":false,"start_time":"2025-05-16T01:45:06.79984","status":"completed"},"tag