  x = \"Total Steps\",\n","       y = \"Calories Burned\") +\n","  theme_minimal()"]},{"cell_type":"markdown","id":"e8f55538","metadata":{"papermill":{"duration":0.038538,"end_time":"2025-05-16T01:45:18.558243","exception":false,"start_time":"2025-05-16T01:45:18.519705","status":"completed"},"tags":[]},"source":["This scatter plot shows the relationship between daily steps and calories burned. The trend line indicates a positive correlation, suggesting that as daily steps increase, calories burned also increase. This is consistent with the earlier correlation analysis.\n","\n","### Calories Burned & Step Count\n","-There’s a strong positive correlation between Total Steps and Calories     Burned—meaning more movement leads to higher calorie expenditure.\n","-The relationship follows a predictable trend, but some users burn fewer calories despite higher steps, indicating potential differences in metabolism or exercise intensity.\n","\n","### Activity Level Impact\n","Users were grouped into five categories based on their daily step count:\n","- Very Active       (12,500+ steps)           → Highest calorie burn\n","- Highly Active     (10,000 – 12,499 steps)   → Consistently high burn\n","- Active            (7,500 – 9,999 steps)     → Moderate calorie expenditure\n","- Moderately Active (5,000 – 7,499 steps)     → Lower burn but some activity\n","- Sedentary         (<5,000 steps)            → Least calories burned\n","Sedentary users burn significantly fewer calories, highlighting the need for behavioral interventions to encourage movement.\n","\n","### Key Business Insights\n","- Motivating Low-Step Users: Fitness apps & devices should emphasize small, achievable movement goals to help sedentary users gradually increase activity.\n","- Personalized Fitness Solutions: Calorie trends suggest users could benefit from adaptive workout plans based on real-time tracking.\n","- Marketing Strategy: Targeting highly active users with advanced analytics and sedentary users with beginner-friendly fitness motivation can improve engagement.\n","\n","## Eploring the Sleep Trend: Summary Statistics for Sleep Metrics\n","First, let’s get an overview of sleep patterns:"]},{"cell_type":"code","execution_count":44,"id":"ff22c67d","metadata":{"execution":{"iopub.execute_input":"2025-05-16T01:45:18.632193Z","iopub.status.busy":"2025-05-16T01:45:18.630569Z","iopub.status.idle":"2025-05-16T01:45:18.653571Z","shell.execute_reply":"2025-05-16T01:45:18.651196Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":0.064292,"end_time":"2025-05-16T01:45:18.65695","exception":false,"start_time":"2025-05-16T01:45:18.592658","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":[" TotalMinutesAsleep TotalTimeInBed \n"," Min.   : 58.0      Min.   : 61.0  \n"," 1st Qu.:361.0      1st Qu.:403.8  \n"," Median :432.5      Median :463.0  \n"," Mean   :419.2      Mean   :458.5  \n"," 3rd Qu.:490.0      3rd Qu.:526.0  \n"," Max.   :796.0      Max.   :961.0  "]},"metadata":{},"output_type":"display_data"}],"source":["# Summary statistics for sleep metrics\n","sleep_n_activity %>%\n","  select(TotalMinutesAsleep, TotalTimeInBed) %>%\n","  summary()"]},{"cell_type":"markdown","id":"d372088d","metadata":{"papermill":{"duration":0.037057,"end_time":"2025-05-16T01:45:18.727882","exception":false,"start_time":"2025-05-16T01:45:18.690825","status":"completed"},"tags":[]},"source":["### Checking Correlation Between Sleep & Activity\n","Do users who take more steps tend to sleep more or less? Let’s check:"]},{"cell_type":"code","execution_count":45,"id":"131b8384","metadata":{"execution":{"iopub.execute_input":"2025-05-16T01:45:18.799976Z","iopub.status.busy":"2025-05-16T01:45:18.798301Z","iopub.status.idle":"2025-05-16T01:45:18.817965Z","shell.execute_reply":"2025-05-16T01:45:18.815896Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":0.059422,"end_time":"2025-05-16T01:45:18.820846","exception":false,"start_time":"2025-05-16T01:45:18.761424","stat