,\n","         y = \"Total Minutes Asleep\") +\n","    scale_fill_manual(values = c(\"Sedentary\" = \"#1f77b4\", \n","                                 \"Moderately Active\" = \"#ff7f0e\", \n","                                 \"Active\" = \"#2ca02c\", \n","                                 \"Highly Active\" = \"#d62728\", \n","                                 \"Very Active\" = \"#9467bd\")) +\n","    theme_minimal() +\n","    theme(axis.text.x = element_text(angle = 45, hjust = 1),\n","          legend.position = \"none\"),\n","  \n","  ggplot(sleep_n_activity, aes(x = activity_level, y = SleepEfficiency, fill = activity_level)) +\n","    geom_boxplot() +\n","    labs(title = \"Sleep Efficiency Distribution\",\n","         x = \"Activity Level\",\n","         y = \"Sleep Efficiency (%)\") +\n","    scale_fill_manual(values = c(\"Sedentary\" = \"#1f77b4\", \n","                               \"Low Active\" = \"#ff7f0e\", \n","                               \"Active\" = \"#2ca02c\", \n","                               \"High Active\" = \"#d62728\", \n","                               \"Very Active\" = \"#9467bd\")) +\n","    theme_minimal() +\n","    theme(plot.title = element_text(hjust = 0),\n","          axis.text.x = element_text(angle = 45, hjust = 1),\n","          legend.position = \"none\"),\n","  \n","  ggplot(sleep_n_activity, aes(x = SedentaryMinutes, y = TotalMinutesAsleep)) +\n","    geom_point(alpha = 0.6, color = \"blue\") +\n","    geom_smooth(method = \"lm\", color = \"red\", se = FALSE) +\n","    labs(title = \"Sedentary Minutes vs. Minutes Asleep\",\n","         x = \"Sedentary Minutes\",\n","         y = \"Minutes Asleep\") +\n","    theme_minimal() +\n","    theme(plot.title = element_text(hjust = 0),\n","          plot.margin = margin(10, 10, 10, 10)),\n","  \n","  ggplot(sleep_n_activity, aes(x = DayOfWeek, y = TotalSteps, fill = activity_level)) +\n","    geom_col(position = \"dodge\") +\n","    labs(title = \"Activity Levels by Day of the Week\",\n","         x = \"Day of the Week\",\n","         y = \"Total Steps\") +\n","    scale_fill_manual(values = c(\"Sedentary\" = \"#1f77b4\", \n","                               \"Low Active\" = \"#ff7f0e\", \n","                               \"Active\" = \"#2ca02c\", \n","                               \"High Active\" = \"#d62728\", \n","                               \"Very Active\" = \"#9467bd\")) +\n","    theme_minimal() +\n","    theme(axis.text.x = element_text(angle = 45, hjust = 1),\n","          legend.position = \"none\"),\n","  \n","  ggplot(sleep_n_activity, aes(x = DayOfWeek, y = TotalSteps, fill = activity_level)) +\n","    geom_col(position = \"dodge\") +\n","    labs(title = \"Activity Levels by Day of the Week\",\n","         x = \"Day of the Week\",\n","         y = \"Total Steps\") +\n","    scale_fill_manual(values = c(\"Sedentary\" = \"#1f77b4\", \n","                               \"Low Active\" = \"#ff7f0e\", \n","                               \"Active\" = \"#2ca02c\", \n","                               \"High Active\" = \"#d62728\", \n","                               \"Very Active\" = \"#9467bd\")) +\n","    theme_minimal() +\n","    theme(axis.text.x = element_text(angle = 45, hjust = 0),\n","          legend.position = \"bottom\"),\n","  \n","  nrow = 3, ncol = 2\n",")"]},{"cell_type":"markdown","id":"dc59679f","metadata":{"_kg_hide-input":false,"papermill":{"duration":0.062112,"end_time":"2025-05-16T01:48:21.276973","exception":false,"start_time":"2025-05-16T01:48:21.214861","status":"completed"},"tags":[]},"source":["\n","## Key Takeaways\n","### Sleep Efficiency & Activity Levels\n","- Moderate & Highly Active users tend to have better sleep efficiency compared to Sedentary users.\n","- Too much or too little activity can negatively impact sleep — finding the right balance matters.\n","- Weekend vs. Weekday Trends: Some users sleep more on weekends, but efficiency may drop due to inconsistent bedtime patterns.\n","\n","### Calories Burned & Movement Trends\n","- Strong positive correlation between Total Steps & Calories Burned — more movement leads to higher calorie expenditure.\n","- Some users burn fewer calories despite high steps, indicating differences in exercise intensity & metabolism.\n","- Sedentary users have significantly lower calorie burn, emphasizing the need for movement-based interventions.\n","### Predictive Modeling & Business Applications\n","- Sleep duration can be predicted using factors like activity level, total steps, and sedentary minutes but more indepth research is required.\n","- AI-powered insights can help fitness platforms recommend personalized sleep & activity optimization strategies.\n","### Actionable Recommendations for Business Strategy\n","- Motivating Low-Step Users: Introduce small, achievable movement goals to increase activity gradually.\n","- Personalized Sleep Coaching: Adjust workout timing suggestions based on users’ nighttime recovery patterns.\n","- Marketing Strategy: Promote health benefits of activity-driven sleep improvements & offer insights through wearables\n","\n","\n","## Recommendation\n","### Implementation Plan for User Engagement\n","#### Personalized Sleep Coaching\n","- Develop an AI-powered sleep insight feature that tracks user activity and predicts optimal sleep routines.\n","- Provide habit-based recommendations, such as adjusting bedtime or workout timing.\n","- Integrate a sleep recovery score that helps users understand their sleep trends.\n","#### Motivating Low-Step Users\n","- Launch daily movement challenges with interactive rewards.\n","- Offer personalized step goals based on sleep efficiency trends.\n","- Develop progressive habit-tracking features to keep users engaged over time.\n","#### Enhancing Data Visibility\n","- Introduce weekly and monthly trend reports for users to visualize sleep efficiency.\n","- Provide interactive charts & comparisons—let users benchmark their habits.\n","- Offer real-time sleep alerts when inefficiencies are detected.\n","#### Implementation Timeline:\n","- Short-Term (0-3 months): Introduce basic tracking & weekly reports.\n","- Mid-Term (3-6 months): AI-powered sleep coaching integration.\n","- Long-Term (6-12 months): Custom habit formation features & advanced insights.\n","\n","### Monetization & Business Growth Strategies\n","#### Premium Subscription Model\n","- Offer a tiered model with advanced AI-powered sleep coaching insights.\n","- Include exclusive reports & predictive analytics for paying users.\n","- Provide personalized habit recommendations with expert-backed insights.\n","#### Corporate & Workplace Wellness Partnerships\n","- Partner with organizations to deliver sleep & activity coaching for employees.\n","- Develop an enterprise sleep tracking dashboard for corporate wellness programs.\n","- Leverage predictive data insights to improve productivity in work settings.\n","#### Marketing Strategy: Promote Activity-Sleep Link\n","- Launch an educational campaign highlighting the importance of activity for sleep optimization.\n","- Develop user stories & success cases to validate AI-driven sleep insights.\n","- Position the product as a holistic wellness solution rather than just an activity tracker.\n","#### Implementation Timeline:\n","- Short-Term (0-3 months): Marketing & user story campaigns.\n","- Mid-Term (3-6 months): Premium subscription model launch.\n","- Long-Term (6-12 months): Workplace wellness integration & enterprise dashboard.\n","\n","### Product Development & Feature Expansion\n","#### Smart Sleep Alerts\n","- Notify users when their workout timing is negatively impacting sleep.\n","- Suggest adjustments based on movement & recovery insights.\n","#### Improved Sleep Tracking Accuracy\n","- Develop a comprehensive sleep efficiency score, considering movement quality & sleep consistency.\n","- Introduce real-time sleep-wake tracking integration for wearables.\n","#### Seasonal & Behavioral Pattern Recognition\n","- Use predictive modeling to suggest behavior shifts based on seasonal changes.\n","- Personalize recommendations based on weekday vs. weekend sleep trends.\n","#### Implementation Timeline:\n","- Short-Term (0-3 months): Smart sleep alerts & basic pattern detection.\n","- Mid-Term (3-6 months): AI-powered insights & seasonal adjustments.\n","- Long-Term (6-12 months): Real-time sleep tracking expansion for wearables."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":198.725419,"end_time":"2025-05-16T01:48:21.457515","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-05-16T01:45:02.732096","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}